import React from 'react';

const login = () => {
    return (
        <div>
            <h1>Login</h1>
            <form>
                <input>
                    type = "email"
                    placeholder = "Email"
                    required
                </input>

                <input>
                    type = "password"
                    placeholder = "Password"
                    required
                </input>

                <button type>Login</button>
            </form>
        </div>
    );
}

export default login;
